import React from "react";
import styles from "../../styles/communitypage.module.scss";
import post from "./Post";
import {Posts} from "../../interface/posts";

interface Post {
    id: number;
    title: string;
    date: string;
    time: string;
    address: string;
    people: string;
    description: string;
    place: { lat: number, lng: number };
}

const Item = ({ title, date, time, address, people, description, place } : Posts ) => {
    return (
        <div className={styles.postItem}>
            <h2>{title}</h2>
            <p>날짜: {date}</p>
            <p>시간: {time}</p>
            <p>장소: {address}</p>
            <p>인원: {people}</p>
            <p>{description}</p>
        </div>
    );
};

export default Item;
